import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { LoginService } from 'src/app/services/login.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

  constructor(private router:Router,private service:LoginService){}
username: any;
password: any;

loginUser() {
  this.service.loginUser(this.username,this.password).
  subscribe((response)=>{
    if(response!=null){
      console.log(response)
      this.router.navigate(['/home'])
    }else{
      alert("username or ")
    }
  })

//  console.log(this.username)
//  console.log(this.password)

//  const validUsername="abhi"
//  const validPassword="deep"

//  if(this.username===validUsername && this.password==validPassword){
//   this.router.navigate(['/home']);
//  }else{
//   alert("invalid username or password")
//  }
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <title>Login </title>

  <link rel="preconnect" href="https://fonts.gstatic.com">
  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.4/css/all.min.css">
  <link href="https://fonts.googleapis.com/css2?family=Poppins:wght@300;500;600&display=swap" rel="stylesheet">


</head>
<body>
  <div class="background">
    <div class="shape"></div>
    <div class="shape"></div>
  </div>
  <form (ngSubmit)="loginUser()">
    <h3>Login Here</h3>

    <label for="username">Username</label>
    <input type="text" placeholder="Email or Phone" id="username"
     name="username" [(ngModel)]="username" required>

    <label for="password">Password</label>
    <input type="password" placeholder="Password" id="password"
    name="password" [(ngModel)]="password">

    <button type="submit" class="btn btn-primary">sign In</button>

    <div class="social">
      <div class="go"><a href="signup">Sign Up</a></div>
      <div class="fb"><i class="fab fa-facebook"> Facebook</i></div>
    </div>
  </form>
</body>
</html>
